  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:16.581937\",\n\t\"name\": \"lee-metcalf-national-wildlife-refuge-annual-narrative-report-calendar-year-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lee Metcalf
  NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the management
  plan, public participation, compliance with environmental and cultural resource
  mandates, and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, other man-power programs, volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, grasslands, other habitats, haying, fire management, and pest
  control. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, other resident wildlife, fishery resources, animal control, marking
  and banding, and disease prevention and control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive trails, hunting, fishing,
  wildlife observation, picnicking, and law enforcement. The equipment and facilities
  section of the report provides information about rehabilitation, major maintenance,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end. Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
